> I need help I don't understand nothing going on. I don't know how to find my wallets, I dont understand what a node is?, I don't understand please help me thank .

@curtcurt380 this isn't the place for user support. I would suggest looking into [the docs on bitcoin.org](https://bitcoin.org/en/resources#learn), starting with the [FAQ](https://bitcoin.org/en/faq).

If you can't get your bearings there, I'd reach out to one of the [online user communities](https://bitcoin.org/en/community) for help. [r/bitcoin](https://www.reddit.com/r/Bitcoin/) has a lot of helpful people.
